import React from "react";
import { Block, Container } from "./Forecast";

const Useless = ({ wind, sunset, sunrise }) => {
    return (
        <Container>
            <Block>{wind}</Block>
            <Block>{sunset}</Block>
            <Block>{sunrise}</Block>
        </Container>
    );
};

export default Useless;
